import React from 'react';
import ReactModal from 'react-modal';

const MyModal = ({props}) => {
    return (
        <>
            <ReactModal isOpen={props.modal} onRequestClose={props.setMyModal} style={props.modalStyle}>
                <div>모달 입니다.</div>
            </ReactModal>
        </>
    );
};

export default MyModal;
